import React from "react";
import { Button, Divider } from "antd";
import ChatBox from "../../components/ChatBox/ChatBox";
import "./style.css";

export default function Room() {
  return (
    <>
      <div className="wrapper">
        <div className="game-container">
          <div className="user-list-container">user list (score)</div>
          <div className="canvas-container">white board</div>
          <div className="input-area">
            <ChatBox tooltip="答案"/>
            {/* <Divider type="vertical" /> */}
            <ChatBox tooltip="聊天"/>
            <div className="button-area">
              <Button type="primary" shape="round">开始游戏</Button>
              <Button shape="round">离开房间</Button>
            </div>
          </div>
          {/* <div className="tool-container"></div> */}
        </div>
      </div>
    </>
  );
}
